import React,{useState} from 'react';
import SubmitForm from './submitform';


 function ShowmodalForm(){
  const[modalForm,setModalForm]=useState(false)
  const ShowForm=()=>{
    setModalForm(true)
  }
}





function App() {


  return (
    <div className="App">
      <header className="App-header">
        <SubmitForm/>
        <modalForm/>
        <button onClick={ShowmodalForm}>submit form</button>
      </header>
    </div>
  );
}

export default App;
